import React from "react";
import "../../../Styles/Pages/ToSell/ToSellFourth.scss";

function ToSellFourth() {
  return (
    <div className='toSellFourth'>
      <div className='toSellFourth__left'></div>
      <div className='toSellFourth__right'>
        <h1>Sell any product or service, digital or physical.</h1>
        <p>
          No matter what type of products you are selling - digital, physical or
          services, on a one-time or recurring basis - our commerce platform
          will help you get ready for global online sales in no time.
        </p>
      </div>
    </div>
  );
}

export default ToSellFourth;
